webpackJsonp([0xad93b62ef76],{3445:function(t,a){t.exports={data:{markdownRemark:{html:"<h2>TKDレポその2!</h2>\n<p>(その1はログ消失。) 前回、全体的にテンポが速い、と言ったが、実際、選曲した曲が偶然速かっただけの様だ。AFRICAなんかは結構遅い。それに、矢印が60fpsになったので、実際のテンポより余計早く感じた。後、マニアック。マニアックの出し方は、(基本的に全ての裏技は)左右の選曲ボタンを押しながらスタート。ちょうどバーサスと同じ。  しかも矢印が変わる。通常はなんかシンプルな感じだが、トリック(昔のANOTHER)はなんかぐちゃ、とした感じ、マニアックはなんかゴテゴテした感じ。難易度は、そうムズいのはない。矢印の間隔が気持ち広くなった事で、店舗を取りづらくなった。あと、人間消える。 以上。</p>",frontmatter:{cover:null,date:"1999-07-31T15:52:00+09:00",strDate:"1999/7/31",title:"だーれもいない部屋で1人悲しくレポ。(DDR-TKD)"}}},pathContext:{path:"/ja/blog/1999/07/31-report-of-ddr-tkd/",langKey:"ja"}}}});
